        ) {
          event.target.value = (
            (props.old[i] * props.infoprecent[ar1[i]]) /
            100
          ).toFixed(2);
          props.SetInfo({ ...props.info, a: event.target.value });
        }
      }
    }
  }
  console.log(props.axalisabolooMoxmareba);
  console.log(props.newval);

  function changeInputValueFromNumber(event) {
    for (let i = 0; i < ar1.length; i++) {
